import React from 'react'

export default function Select(props) {

  const defaultOpt = () => {
    if(props.defultOpt) {
      return <option>{props.defultOpt}</option>
    }
  }

  return (
    <div>
      <select onChange={props.onChangeFn}>
        
        {props.options.map(option => <option value={option}>{option}</option>)}
      </select>
  </div>
  )
}
